import React from 'react';

export const New = () => {
    return (
			<div className='new'>
				<h2>ADD A NEW SONG</h2>
				<form>
					<div>
						<label>Title</label>
						<input type='text'></input>
					</div>
					<div>
						<label>Artist</label>
						<input type='text'></input>
					</div>
					<div>
						<label>Time</label>
						<input type='text'></input>
					</div>
                    <input type="submit" />
				</form>
			</div>
		);
};
